require 'time'

def run(input)
  loop {
    n = remove_pairs(input)

    if input == n
      break
    else
      input = n
    end
  }

  input.length
end

def remove_pairs(string)
  s = string

  ('a'..'z').map do |letter|
    s = s.gsub("#{letter}#{letter.upcase}", '').gsub("#{letter.upcase}#{letter}", '')
  end

  s
end

test_cases = [
  ['dabAcCaCBAcCcaDA', 10]
]

test_cases.each do |input, output|
  raise "Test case failed:" if run(input) != output
end

lines = DATA.read.chomp
puts run(lines)

